Patch Set 14:

1. Looked into # of runtime filter differences and found that the Query options set during normal planning phase are get re-reused in re-plannng phase. Fixed it by making a copy and restore the copy before re-planning phase;

2. Investigated row_size difference for UNNEST node: 0B expected vs 13B actual: found a bug in UnnestNote.init() where the memory layout is computed after computeStats() is called from PlanNode.init(). Fixed the bug and Updated tpch-nested.test accordingly.
